class homotopypath():
    def __init__(self):
        self.G = nx.Graph()
        self.x = []
        self.y = []
        self.path = []
        self.trajectory = []
        self.integral = []
        self.inner = nx.Graph()
        self.innerpath = []


    def readpoly(self, fname):
        fin = open(fname)
        line = fin.readline()

        l = line.split()
        n = int(l[0])

        for i in range(n):
            line = fin.readline()
            l = line.split()
            self.inner.add_node(int(l[0]), x=float(l[1]), y=float(l[2]))

        fin.readline()
        line = fin.readline()
        l = line.split()
        n = int(l[0])
        counter = 0
        flag = 0
        for i in range(n):
            line = fin.readline()
            l = line.split()
            self.inner.add_edge(int(l[1]), int(l[2]))
            if flag == 0:
                self.innerpath.append([int(l[1]), int(l[2])])
                flag = 1
            else:
                l1 = int(l[1])
                l2 = int(l[2])
                if l1 < l2:
                    self.innerpath[counter].append(l2)
                else:
                    flag = 0
                    counter += 1
        print(self.innerpath)



        fin.close()


    def readfile(self, fname):
        fin = open(fname)

        line = " "

        while line != "":
            line = fin.readline()
            if line == "" or line[0] == "#":   # ignore the commment part
                continue

            l = line.split()
            if l[0] == "Vertex":
                self.G.add_node(int(l[1]), x=float(l[2]), y=float(l[3]), z=float(l[4]))

            if l[0] == "Face":
                self.G.add_edge(int(l[2]), int(l[3]))
                self.G.add_edge(int(l[3]), int(l[4]))
                self.G.add_edge(int(l[4]), int(l[2]))

            if l[0] == "Edge":
                continue

    def readdv(self, dvname):
        fin = open(dvname)

        line = " "

        while line != "":
            line = fin.readline()
            if line == "" or line[0] == "#":   # ignore the commment part
                continue

            l = line.split()
            if l[0] == "Vertex":
                continue

            elif l[0] == "Face":
                continue

            elif l[0] == "Edge":
                v1 = int(l[1])
                v2 = int(l[2])
                weight = float(l[3][l[3].find('(')+1:l[3].find(')')])
                if v1 > v2:
                    (v1, v2) = (v2, v1)
                    weight = -weight

                self.G.add_edge(v1, v2, w=weight)

     #           for e in self.G.edges_iter():
      #              print('%d, %d, %.5f' % (e[0],e[1],self.G.edge[e[0]][e[1]]['w']))



